import "./App.css";
import { useState } from "react";
import NativeTokens from "./components/NativeTokens";
import Tokens from "./components/Tokens";
import TransferHistory from "./components/TransferHistory";
import Nfts from "./components/Nfts";
import WalletInputs from "./components/WalletInputs.js";
import PortfolioValue from "./components/PortfolioValue";

function App() {
	const [wallet, setWallet] = useState("");
  const [chain, setChain] = useState("0x1");
  const [nativeBalance, setNativeBalance] = useState(0);
  const [nativeValue, setNativeValue] = useState(0);
  const [tokens, setTokens] = useState([]);
  const [nfts, setNfts] = useState([]);
  const [filteredNfts, setFilteredNfts] = useState([]);
  const [transfers, setTransfers] = useState([]);


  return (
    <div className="App">

			<div className="header">
				<div className="container">
					<div className="header-top">
						<div className="header-top-top">
							<div className="header-top__logo">
								<img src="NFT8.png" alt="logo"></img>
							</div>
							<div className="header-top__right">
								<ul className="nav1">
									<li className="haeder-top__list">Collection</li>
									<li className="haeder-top__list">Content</li>
									<li className="haeder-top__list">Roadmap</li>
									<li className="haeder-top__list">Team</li>
								</ul>
								<div className="header_top_btn btn">
									OpenSea
								</div>
							</div>
						</div>
						<div className="header-top__main">
							<p className="top-subtitle">
								NFT Collection
							</p>
						</div>
					</div>
				</div>
			</div>

     <WalletInputs 
        chain={chain}
        setChain={setChain}
        wallet={wallet}
        setWallet={setWallet}
      />
      <NativeTokens
        wallet={wallet}
        chain={chain}
        nativeBalance={nativeBalance}
        setNativeBalance={setNativeBalance}
        nativeValue={nativeValue}
        setNativeValue={setNativeValue}
      />
      <Tokens 
        wallet={wallet} 
        chain={chain}
        tokens={tokens}
        setTokens={setTokens} />
      <PortfolioValue 
        nativeValue={nativeValue}
        tokens={tokens}  
      />
      <TransferHistory 
        chain={chain} 
        wallet={wallet}
        transfers={transfers}
        setTransfers={setTransfers}
      />
      <Nfts 
        wallet={wallet} 
        chain={chain}
        nfts={nfts}
        setNfts={setNfts}
        filteredNfts={filteredNfts}
        setFilteredNfts={setFilteredNfts}
      />
    </div>
  );
}

export default App;
